import React, { Component } from 'react';
class Table2 extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLoaded: true,
            error: null,
            data:[] 
         }
    }
    componentDidMount(){
        console.log("hello");
        fetch("/api/v2/tickers")
        .then((response) => response.json())
        .then((result) => {
            this.setState({
                data: result,
                isLoaded:true
            });
        })
        .catch((error) => {
            this.setState({
                isLoaded:true,
                error
            })
        });
    }

    render() { 
         const {error, isLoaded, data} = this.state;
        

        if (error){
            return <div>Error: {error.message}</div>
        } else if(!isLoaded){
            return <div>Loading...</div>
        }
        else{
            const res = [];
            res.push(data);
            return <div>{res.map(res=>(
                <div key={res.name}>{res.name}</div>
            ))}</div>
        }
    }
}
 
export default Table2;
